import React from 'react';
import { Title } from './style/componentsStyle'
import GlobalStyle from './style/global'
import Img from 'react-image'

function App() {
  return (
    <div className="App">
      <GlobalStyle />
      <Title>Leonardo da Vinci</Title>
      <Img src = './Images/Leonardo.jpg' />
    </div>
  );
}

export default App;
